import React from 'react';
import styled from 'styled-components';
import Typewriter from 'typewriter-effect';
import Me from '../assets/Me.jpg';

const HomeSection = styled.section`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding: 4em 2em;
  background: linear-gradient(135deg, #333, #4ca1af);
  color: white;
  text-align: center;
  min-height: 100vh;
`;

const HeroTitle = styled.h1`
  font-size: 4em;
  margin-bottom: 0.5em;
`;

const HeroSubtitle = styled.div`
  font-size: 1.5em;
  color: white;
  margin-top: 1em;
`;

const AnimatedPhoto = styled.img`
  width: 200px;
  height: 200px;
  border-radius: 50%;
  border: 5px solid white;
  box-shadow: 0px 5px 15px rgba(0, 0, 0, 0.5);
`;

const Home = () => {
  return (
    <HomeSection>
      <AnimatedPhoto src={Me} alt="Tanishq Jain" />
      <HeroTitle>Hi, I'm Tanishq Jain</HeroTitle>

      <HeroSubtitle>
        <Typewriter
          options={{
            strings: ['DevOps Engineer', 'Full-Stack Developer'],
            autoStart: true,
            loop: true,
            deleteSpeed: 50,
            delay: 75,
          }}
        />
      </HeroSubtitle>
    </HomeSection>
  );
};

export default Home;
